import React from "react";
import styled from 'styled-components'

const Wrapper = styled.div`
    display: flex;
    width: 844px;
    margin: auto;
    font-family: MuseoSansBold,sans-serif;
`

export const InfoInNumbers = () => {
    return <Wrapper>
        <div></div>
    </Wrapper>
}
